            <div className="texts">
                <h2 style={{fontSize: '50px'}}>{item.name}</h2>
                <p style={{fontSize: '20px'}}> {item.foodType}, {item.location}, {item.rating}</p>
                <p>{item.description}</p>
                <p><a href={item.web}>сайт</a></p>
            </div>
    </div>
    )
}
